import React from 'react';

export default function BackToTop() {
    return (
        <React.Fragment>
            <style jsx>{
                `
                header{
                    display:flex;
                }
                header img{
                        width: 10%;
                }
                `
            }</style>
            <header>
                <img src='../../static/img/icon.png'></img>
                <h1>黒猫ノンちゃん</h1>
            </header>
        </React.Fragment>
    );
}
